A Nightmare on Elm Street 2 - Freddy's Revenge 1985

Verenigde Staten
Horror
87 minuten

geregisseerd door Jack Sholder
met Robert Englund, Kim Myers en Mark Patton

De familie Walsh trekt in het huis aan Elm Street en het duurt niet lang voor hun zoon 
Jesse nachtmerries krijgt over de overleden kindermoordenaar Freddy Krueger. Dit keer 
probeert Freddy om het lichaam van Jesse over te nemen, om zo ellende te kunnen veroorzaken 
in de echte wereld.
